// Navigation.js

import React from "react";
import "./navigation.css";
import { Link } from "react-router-dom";

export const Navigation = () => {
  const navContainerStyle = {
    backgroundColor: "#ffc0cb", // Light pink background
    color: "#fff",
    padding: "15px",
    display: "flex",
    justifyContent: "space-between",
    alignItems: "center",
  };

  const h1Style = {
    margin: "10px",
    fontSize: "34px",
  };

  const navigationStyle = {
    display: "flex",
    gap: "10px", // Add a gap of 10px between buttons
  };

  const navButtonStyle = {
    margin: "0",
    padding: "10px",
    color: "#fff",
    backgroundColor: "#2196f3", // Blue button color
    border: "none",
    textDecoration: "none",
    cursor: "pointer",
  };

  const logoutButtonStyle = {
    ...navButtonStyle,
    backgroundColor: "#FF0000", // Red button color
  };

  const navButtonHoverStyle = {
    backgroundColor: "#1565c0", // Darker blue on hover
    borderRadius: "5px",
  };

  return (
    <div style={navContainerStyle}>
      <h1 style={h1Style}>Front office</h1>
      <div style={navigationStyle}>
      <Link to="/Frontofficehome">
          <button style={navButtonStyle}>Home</button>
        </Link>
        <Link to="/Apporve">
          <button style={navButtonStyle}>APPROVE</button>
        </Link>
        <Link to="/Book">
          <button style={navButtonStyle}>BOOK</button>
        </Link>
        <Link to="/ViewAll">
          <button style={navButtonStyle}>VIEW ALL</button>
        </Link>
        <Link to="/">
          <button style={logoutButtonStyle}>Logout</button>
        </Link>
      </div>
    </div>
  );
};
